problem_simple:
A birdbath is designed to overflow so that it will be self-cleaning.  Water flows in at the rate of 30 milliliters per minute and drains at the rate of 15 milliliters per minute.  One of these graphs shows the volume of water in the birdbath during the filling time and continuing into the overflow time.  Which one is it?

[asy]
size(3inch,0.75inch);
for ( int x = 0; x <= 4; ++x )
{

draw((x*1.5,1)--(x*1.5,0)--(x*1.5+1,0));

label(rotate(90)*scale(0.7)*"Volume", (x*1.5-.2,.5));
}
label("$A$", (.5,0), S);
label("$B$", (2,0), S);
label("$C$", (3.5,0), S);
label("$D$", (5,0), S);
label("$E$", (6.5,0), S);
draw((0,0.6)--(0.3,0.6)--(1,0), linewidth(1));
draw((1.5,0)--(2,.5)--(2.5,.5),linewidth(1));
draw((3,0)--(4,.75), linewidth(1));
draw((4.5,.8)--(5.5,.8), linewidth(1));
draw((6,0)--(6.5,.5)--(7,0), linewidth(1));
[/asy]

Provide the correct letter (A, B, C, D, or E) answer.

