draw((0,0)--(.5,.5)--(1,.5),linewidth(1));
draw((1.5,0.6)--(1.8,0.6)--(2.5,0), linewidth(1));
draw((3,0)--(4,.75), linewidth(1));
draw((4.5,.8)--(5.5,.8), linewidth(1));
draw((6,0)--(6.5,.5)--(7,0), linewidth(1));
[/asy]

Provide the correct letter (A, B, C, D, or E) answer.

problem_simple:
The foci of the ellipse $\frac{x^2}{49} + \frac{y^2}{33} = 1$ are $F_1$ and $F_2,$ as shown below.  Let $P$ be a point on the circle $x^2 + (y - 2)^2 = 4.$  Line $F_2 P$ intersects the ellipse again at $Q,$ where the $y$-coordinate of $Q$ is positive.  Find the maximum value of $PQ + F_1 Q.$

[asy]
unitsize(0.4 cm);

pair P, Q;
pair[] F;

path ell = yscale(sqrt(33))*xscale(7)*Circle((0,0),1);
F[1] = (4,0);
F[2] = (-4,0);
P = (0,3) + 2*dir(240);
Q = intersectionpoint(P--interp(F[2],P,5),ell);

draw(ell);
draw((-8,0)--(8,0));
draw((0,-7)--(0,7));
draw(Circle((0,3),2));
draw(F[1]--Q--F[2]);

dot("$F_1$", F[1], S);
dot("$F_2$", F[2], S);
dot("$P$", P, S);
label("$Q$", Q, NE);
[/asy]

problem_hard:
The foci of the ellipse $\frac{x^2}{49} + \frac{y^2}{33} = 1$ are $F_1$ and $F_2,$ as shown below.  Let $P$ be a point on the circle $x^2 + (y - 3)^2 = 4.$  Line $F_2 P$ intersects the ellipse again at $Q,$ where the $y$-coordinate of $Q$ is positive.  Find P when $PQ + F_1 Q.$ is maximized. [asy]
unitsize(0.4 cm);

pair P, Q;
pair[] F;

path ell = yscale(sqrt(33))*xscale(7)*Circle((0,0),1);
F[1] = (4,0);
F[2] = (-4,0);
P = (0,3) + 2*dir(240);
Q = intersectionpoint(P--interp(F[2],P,5),ell);

draw(ell);
draw((-8,0)--(8,0));
draw((0,-7)--(0,7));
draw(Circle((0,3),2));
draw(F[1]--Q--F[2]);

dot("$F_1$", F[1], S);
dot("$F_2$", F[2], S);
dot("$P$", P, S);
label("$Q$", Q, NE);
[/asy]

If $f(x)$, whose graph is shown below, is defined on $1 \le x \le 6$, what is the maximum value of $f^{-1}(x)+x+1$? [asy]

import graph; size(7.94cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-0.96,xmax=8.96,ymin=-2.66,ymax=4.38;

Label laxis; laxis.p=fontsize(10);

xaxis("$x$",-0.96,8.96,Ticks(laxis,Step=1.0,Size=2,OmitTick(0)),Arrows(6),above=true); yaxis("$y$",-2.66,4.38,Ticks(laxis,Step=1.0,Size=2,OmitTick(0)),Arrows(6),above=true); draw((1,2)--(3,0),linewidth(1.2)); draw((3,3)--(5,2),linewidth(1.2)); draw((5,-2)--(6,0),linewidth(1.2)); filldraw(circle((5,-2),0.08),white); label("$ f(x) $",(0.5,4.3),SE*lsf);

dot((3,0),UnFill(0)); dot((1,2)); dot((3,3)); dot((5,2),ds); dot((6,0));

clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);

[/asy]

problem_simple:
Let  \[f(x) =
\begin{cases}
k(x) &\text{if }x>2, \\
x^2-6x+10&\text{if }x\leq2.
\end{cases}
\] Find the function $k(x)$ such that $f$ is its own inverse.

problem_hard:
Let  \[f(x) =
\begin{cases}
k(x) &\text{if }x>0, \\
x^4 - 4x^3 + 6x^2- 4x &\text{if }x\leq 0.
\end{cases}
\] Find the function $k(x)$ such that $f$ is its own inverse.
